# use ext_php_rs::prelude::*;
# #[derive(Default, ZendObjectHandler)]
# pub struct Human {
# name: String,
# age: i32
# }
#[php_impl]
impl Human { const MAX_AGE: i32 = 100; pub fn __construct(&mut self, name: String, age: i32) { self.name = name; self.age = age; } pub fn get_name(&self) -> String { self.name.to_string() } pub fn get_age(&self) -> i32 { self.age } pub fn introduce(&self) { println!("My name is {} and I am {} years old.", self.name, self.age); } pub fn get_max_age() -> i32 { Self::MAX_AGE }
} Using our newly created class in PHP: <?php $me = new Human('David', 20); $me->introduce(); // My name is David and I am 20 years old.
var_dump(Human::get_max_age()); // int(100)
var_dump(Human::MAX_AGE); // int(100)

